  \"2016-11-25T21:06:24.233937\",\n\t\"name\": \"education-longitudinal-study-of-2002\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Education Longitudinal Study of 2002
  (ELS:2002; http://nces.ed.gov/surveys/els2002/) is a study that is a part of the
  Education Longitudinal Study program. It is a longitudinal survey that monitors
  the transitions of a national sample of young people as they progress from tenth
  grade to, eventually, the world of work. In 2004, the sample was augmented to make
  it representative of seniors as well. The study was conducted using self-administered
  questionnaires and cognitive tests of students, parents, teachers, librarians, and
  school administrators. Students and their high school administrators, library media
  coordinators, mathematics and English teachers, and parents in the spring term of
  the 2002 school year were sampled. The studyufffds base year weighted response rate
  was 87.3 percent for students, 98.5 percent for school administrators, 95.9 percent
  for library media coordinators, 91.6 percent for both mathematics and English teachers,
  87.5 percent for parents, and 67.8 percent for schools. Key statistics produced
  from ELS:2002 focus on the changes taking place in the lives of students which can
  be understood by life achievements, aspirations, and experiences.\",\n\t\"license_title\":
